  XW += x[38] * 39.057000;  // c3h3
  XW += x[39] * 104.105000; // nc4ket13
  XW += x[40] * 72.107000;  // nc3h7cho
  XW += x[41] * 71.099000;  // c2h5coch2
  XW += x[42] * 85.126000;  // nc3h7coch2
