  XW += x[45] * 100.205000; // nc7h16
  XW += x[46] * 131.195000; // c7h15o2-1
  XW += x[47] * 131.195000; // c7h15o2-2
  XW += x[48] * 131.195000; // c7h15o2-3
  XW += x[49] * 131.195000; // c7h15o2-4
